import axios from "axios";

const axiosInstance = axios.create({baseURL: "http://localhost:3000"})

export async function registeringUser(email, password){
    try{
        const result = await axiosInstance.post('/login', {
            email: email,
            password: password
        });
        return result.data
    }catch(err){
        console.log(err)
    }
}
